import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import Pokedex from "./components/pokedex/pokedex";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img
          alt=""
          src={require("../src/assets/react-pokeball.svg")}
          width="150"
          height="150"
        />
        <h1>React Pokedex</h1>
      </header>
      <Pokedex />
    </div>
  );
}

export default App;
